import React from 'react'

import InterestsStyles from "./Interests.module.css"

const interests = (props) => {
    return (
        <div id={InterestsStyles.interests}>
            <div className={InterestsStyles['interests-icon']}><img src={props.logo}/></div>

            <div className={InterestsStyles['interests-description']}>
                <h4>{props.company}</h4>
                <p>{props.location}</p>
                <p id={InterestsStyles['interests-skills']}>{props.date}</p>
            </div>

        </div>
    )
}

export default interests;
